    "id00281_app:foro:adhesion_error:modal:body": "Unable to adhere to an offer / request for representation if you already have one or are attached.",
    "id00282_app:foro:dashboard:title": "Welcome, ",
    "id00283_app:foro:dashboard:subtitle": "the Electronic Forum %%empresa%%",
    "id00284_app:foro:dashboard:body": "<p>Following the provisions of the \"Law of Corporations\", this platform has been arranged so you can exercise your right to participation.</p><p>As defined in the options, you can:</p><ol><li>Submit your proposals</li><li>Submit your initiatives</li><li>Present your offers or requests for representation, or</li><li>Adhering to those presented by other shareholders</li></ol><p>The menus that appear on the left side of the screen are grouped so you can access the actions taken by other shareholders (public) <i class=\"fa fa-users\"></i>, to which you have created (personal) <i class=\"fa fa-user\"></i> and finally allowing you to create them explicitly <i class=\"fa fa-pencil-square-o\"></i>.</p><p>This is a moderated forum, which means that the options held by the shareholders, will be reviewed by the administrator of the platform, as provided in the regulations thereof. Within hours between 09:00h to 18:00h Monday through Thursday and Friday from 09:00h to 15:00h.</p>",
    "id00285_app:foro:info:modal:title": "Information",
    "id00286_app:foro:offer:info:modal:body": "Content",
    "id00287_app:foro:request:info:modal:body": "Content",
