    "id00290_app:voto:modal:previousaction:cancel": "Cancel",
    "id00291_app:voto:welcome:title": "Welcome, ",
    "id00292_app:voto:welcome:subtitle": "Electronic Voting/Proxy of %%empresa%%",
    "id00293_app:voto:welcome:body": "<p>Following the provisions of the \"Capital Companies Act\", this platform has been arranged so you can exercise your right to participation. </p> <p> From the same may delegate its shares or electronically Voting, as shown in the wizard options. </p> <p> the options presented on the left side of the screen, the wizard correspond to the point where you are. </p> <p>In the last screen you will be prompted to confirm the process and the record will be generated in our database. You will receive a confirmation e-mail with the actions you have registered.</p><p>Finally, shareholders must remember that a vote casted or proxy granted by Internet or through remote communication means will be void in case of physical attendance of the shareholder or in case of disposal of the shares, being the Company aware thereof before the date set for the first call of the Annual General Meeting at.</p> <p> in the bottom right of the screen navigation buttons are displayed. </p> <p> to begin the process, click the button \"Next\". </p>",
