    "id00299_app:representation:atencion": "Attention",
    "id00300_app:voto:shares:body": "<p>Please enter the number of shares of the Company that you hold, if it is different from that indicated when you registered on the Platform. This information will be verified after contrasting with that provided in the \"Book of Shareholders\", the latter being the one that will be considered as valid by the Company in accordance with current regulations.</p>",
