    "id00311_app:voto:delegation:body": "<h3>Choose below who you want to delegate</h3><p>paragraph is understood that you authorize the person to whom you delegate a proxy to vote on matters that even not included in the Agenda, may be submitted to the vote at the General Meeting. In this case the proxy must vote in the sense he deems most favorable to the interests of the shareholder represented, unless you state otherwise in the \"Contact\", the envelope-shaped icon in the upper part of this platform, section of the Platform indicating your name and email</p>",
