    "id00321_app:voto:instructions:body": "<h3>Want to indicate voting instructions?</h3><p>In the event delegation representing the Chairman of the Board of Directors, as well as other directors to which is applied the system of public requests for representation if you do not indicate explicit voting instructions, it is understood to vote in favor of the resolutions proposed by the Board of Directors.</p>",
