    "id00324_app:voto:voto": "Vote",
    "id00325_app:voto:body:vote": "<p>Then indicate their voting instructions.</p><p>You can do this globally from the options that appear after these comments or individually to each point. </p><p> If you do not indicate voting instructions in relation to one or more points of the agenda shall apply that for those points of the agenda, you vote in favor of the proposals made by the Board of Directors.</p><p> In the event delegation representing the Chairman of the Board of Directors, as well as other directors to which is applied the system of public requests for representation if you do not indicate explicit voting instructions, it is understood to vote in favor of the resolutions proposed by the Board of Directors.</p>",
