    "id00374_app:derecho:dashboard:subtitle": "the Law Information %%empresa%%",
    "id00375_app:derecho:dashboard:body": "<p>Following the provisions of the \"Law of Corporations\", this platform has been arranged so you can exercise your right to participation.</p><p>As defined in the options, you can:</p><ol><li>Create new Thread</li><li>View public Threads</li><li>See applications of the entity</li></ol><p>The menus that appear on the left side of the screen are grouped so you can access the actions taken by other shareholders (public) <i class=\"fa fa-users\"></i>, to which you have created (personal) <i class=\"fa fa-user\"></i> and finally allowing you to create them explicitly <i class=\"fa fa-pencil-square-o\"></i>.</p><p>This is a moderated platform, which means that the options held by the shareholders, will be reviewed by the administrator of the platform, as provided in the regulations thereof. Within hours between 09:00h to 18:00h Monday through Thursday and Friday from 09:00h to 15:00h.</p>",
